import React from 'react';
import './Settings.css';

const Settings = () => {
  return (
    <div className="settings">
      <h2>Configurações</h2>
      <div className="settings-content">
        <p>Configurações em desenvolvimento...</p>
      </div>
    </div>
  );
};

export default Settings;
